import React from 'react';
import './Header.css';
import CreateRoomButton from './CreateRoomButton';
import store from '../../store';

store = store.getState();

export default function Header() {
    return (
        <div id="header">
            HEADER
            {store.title}
            <CreateRoomButton />
        </div>   
    )
}
